column33:
导入时，移除函数前置规则是 "_xl[a-z]{2,4}" 字符串

[https://git.shimo.im/office-ot/poi-rust/-/blob/master/poi-formula/src/parser.rs#L934]

如：
{code:java}
//excel 源公式
(MAX(_xlfn._xlws.FILTER(C:C,D:D=F2)))-(MIN(_xlfn._xlws.FILTER(C:C,D:D=F2))) 
// 移除前缀后预期是
(MAX(FILTER(C:C,D:D=F2)))-(MIN(FILTER(C:C,D:D=F2))) {code}

