export function _raiseEditorStatusChanged(this: CoreSheet, oldStatus: any, newStatus: any): void {
  const args = {
    sheet: this,
    sheetName: this.name(),
    oldStatus: oldStatus,
    newStatus: newStatus,
  }

  this._trigger(EditorStatusChanged, args, true)
}
