2025-04-07  15:50:47;liuteng;-- 查询文件的协作者

select count(*) as '文件管理员数量' from svc_file.file_admin;

select count(*) as '文件协作者数量' from svc_file.file_role;

-- 查询目录的数量

select count(*) as '目录数量' from svc_file.file where type = 1 and sub_type = 1;

-- 查询空间的数量

select count(*) as '空间数量' from svc_file.file where type = 1 and sub_type = 2;

-- 查询创建文件的数量

select count(*) as '历史创建文件数量' from svc_file.file where type > 1;

-- 目前已有的文件的数量

select count(*) as '目前已有文件数量' from svc_file.file where type > 1 and deleted_at is null ;

查询的时候跟客户确认一下，数据库会产生慢查询，因为会统计全表，数据量可能比较大;;;

2025-01-16  10:48:15;kete;主要的问题表现：
1、详情页，多行文本 @ 人，placeholder 没有消失
2、详情页，多行文本 @ 人，在详情页外部点击，失焦后，文本内容没有恢复正常样式
3、{-}打开详情页的同时，编辑多行文本单元格，内容未同步，并且编辑完单元格后去编辑详情页，会导致详情页的编辑无效。{-}

以上几个问题，主要涉及到富文本编辑器的失焦时机对于内容的更新，主要思路在于点击事件的触发路径。可能要重构基于事件冒泡机制，通过事件发布订阅来处理。

第三条由于代码设计方面的原因，无法修复。请测试的时候忽略这一点;;;
